import "./Profile.css";

const Profile = ({ name = "John Doe", age = "??", country = "Japan"}) => {
  return (
    <div className="profile">
      <h3>{"Name: " + props.name}</h3>
      <p>{"Age: " + props.age}</p>
      <p>{"From: " + props.country}</p>
    </div>
  );
};


export default Profile;
